<style>
    @keyframes myAnimation {
  0%   {top:-10px;}
  50%  {top: 10px;}
  100% {top:-10px;}
}

.anim {

  animation-name: myAnimation;
  animation-duration: 10s;
  animation-timing-function: ease-in-out;
  animation-iteration-count: infinite;
}
@keyframes hovereded {
  0%   {opacity:50%;}
  50%  {opacity: 100%;}
  100% { opacity:50%;}
}
.end {
  background-color: blueviolet;
  text-decoration-color: #fafafa;
  -webkit-text-fill-color: #fafafa;
}
.mamamia {

  animation-name: hovereded;
  animation-duration: 1s;
  animation-timing-function: ease-in-out;
  animation-iteration-count: infinite;
}
.helpaaa {
  background-image: linear-gradient(to left, #cfcdcd, #fafafa );
}
.blacky{
background-image: url("Untitled\ design.png"); 
background-size: 100% 100%;

}
.mini {
    width: 75px;
    height:50px;
}
.won {  
    background-image: linear-gradient(to left, rgb(206, 18, 18), rgb(235, 97, 79));
  padding: 20px 20px;
  
 
   

}
.to {  
    background-image: linear-gradient(to left, rgb(36, 214, 0), rgb(87, 211, 124));
  padding: 20px 20px;

}
.tree {  
    background-image: linear-gradient(to left, rgb(255, 174, 0), rgb(211, 190, 0));
  padding: 20px 20px;
   

}
.for {  
    background-image: linear-gradient(to left, rgb(255, 255, 255), rgb(201, 201, 201));
  padding: 20px 20px;
   

}
.clive {  
    background-image: linear-gradient(to left, rgb(0, 183, 255), rgb(0, 116, 211));
  padding: 20px 20px;

   

}
.won:hover {
    animation: hovereded;
}
.blurry {
  background: rgba(255, 255, 255, 0.3); /* Semi-transparent background */
  backdrop-filter: blur(10px) ; /* Apply blur to the background */
  border-radius: 10px;
  border: 1px solid rgba(255, 255, 255, 0.5);
}
